import React from 'react';
import logo from './logo.svg';
import call_1 from './call_1.wav';
import './App.css';

function playSound() {
  console.log('play a sound');
  var audio = new Audio(call_1);
  audio.play();
}

function App() {
  return (
    // for each soudn in list of lists
    <button onClick={playSound}>
      Sound 1
    </button>
  );
}

export default App;
